import React, { useState, useEffect } from 'react';

function App() {
  const [scenarios, setScenarios] = useState([]);
  const [formData, setFormData] = useState({ name: '', description: '' });
  const [loading, setLoading] = useState(true);

  // Buscar cenários do backend ao carregar o componente
  useEffect(() => {
    setLoading(true);
    fetch('http://localhost:3000/api/scenarios')
      .then((res) => {
        if (!res.ok) {
          throw new Error('Erro ao buscar cenários');
        }
        return res.json();
      })
      .then((data) => {
        console.log('Cenários recebidos do backend:', data); // Adicionar log
        setScenarios(data);
        setLoading(false);
      })
      .catch((err) => {
        console.error('Erro ao buscar cenários:', err);
        setLoading(false);
      });
  }, []);

  // Buscar um cenário específico pelo ID
const fetchScenarioById = async (id) => {
  try {
    const response = await fetch(`http://localhost:3000/api/scenarios/${id}`);
    if (!response.ok) {
      throw new Error('Erro ao buscar cenário');
    }
    const scenario = await response.json();
    console.log('Cenário recebido:', scenario);
  } catch (error) {
    console.error('Erro ao buscar cenário:', error);
  }
};

  // Atualizar os dados do formulário conforme o usuário digita
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // Criar um novo cenário
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:3000/api/scenarios', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });
      const newScenario = await response.json();
      setScenarios([...scenarios, newScenario]);
      setFormData({ name: '', description: '' });
    } catch (error) {
      console.error('Erro ao criar cenário:', error);
    }
  };

  // Editar um cenário existente
  const handleEdit = async (id) => {
    const updatedScenario = { ...formData }; // Atualiza com os dados do formulário
    try {
      const response = await fetch(`http://localhost:3000/api/scenarios/${id}`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(updatedScenario),
      });
      const result = await response.json();
      setScenarios(scenarios.map((s) => (s.id === id ? result : s)));
    } catch (error) {
      console.error('Erro ao editar cenário:', error);
    }
  };

  // Excluir um cenário existente
  const handleDelete = async (id) => {
    try {
      await fetch(`http://localhost:3000/api/scenarios/${id}`, { method: 'DELETE' });
      setScenarios(scenarios.filter((s) => s.id !== id));
    } catch (error) {
      console.error('Erro ao excluir cenário:', error);
    }
  };
  console.log('Estado scenarios:', scenarios);
  return (
    <div>
      <h1>JQuality Tool</h1>
      <h2>Scenarios</h2>
      {loading ? (
        <p>Loading scenarios...</p>
      ) : (
        <ul>
          {scenarios.length > 0 ? (
            scenarios.map((scenario) => (
            <li key={scenario.id}>
              <strong>{scenario.name}</strong>: {scenario.description} ({scenario.status})
              <button onClick={() => handleEdit(scenario.id)}>Edit</button>
              <button onClick={() => handleDelete(scenario.id)}>Delete</button>
          </li>
        ))
      ) : (
        <p>No scenarios available</p>
      )}
        </ul>
      )}
      <h2>Create Scenario</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="name">Name:</label>
          <input
            type="text"
            id="name"
            name="name"
            value={formData.name}
            onChange={handleChange}
          />
        </div>
        <div>
          <label htmlFor="description">Description:</label>
          <textarea
            id="description"
            name="description"
            value={formData.description}
            onChange={handleChange}
          />
        </div>
        <button type="submit">Create</button>
      </form>
    </div>
  );
}

export default App;
